// Reconstruct and decrypt function
function getDecryptedData() {
  // Check if running in iframe (our viewer)
  if (window.self !== window.top) {
    // Check referrer
    const allowedOrigins = [window.location.origin];
    if (!allowedOrigins.includes(window.location.origin)) {
      throw new Error('Unauthorized access');
    }
  }

  // Time-based check (basic anti-tampering)
  const now = new Date().getTime();
  if (now < 1600000000000 || now > 2000000000000) {
    throw new Error('Invalid time context');
  }

  // Reconstruct base64 from chunks
  let reconstructed = '';
  for (let i = 0; i < dataChunks.length; i++) {
    // Reverse ROT13
    reconstructed += rotCipher(dataChunks[i], 13);
  }

  return reconstructed;
}

